description:
Chính chủ cần tiền bán gấp căn góc rất đẹp 3 Phòng ngủ tại chung cư cao cấp Capital Elite - 18 Phạm Hùng, Nam Từ Liêm, Hà Nội.
Thuận tiện kết nối tới các khu vực Cầu Giấy, Bắc Từ Liêm, Tây Hồ, Thanh Xuân...
Thông tin căn hộ như sau:
+ Diện tích 114 m2
+ Là căn góc nên tất cả các phòng đều sáng;
+ Căn hộ thuộc tầng trung, đẹp.
+ Không lỗi phong thuỷ;
+ Bếp thiết kế riêng rất đẹp;
+ Nội thất bàn giao đầy đủ, cao cấp rất xịn;
+ Tặng Slot đỗ xe ô tô;
+ Tiện ích đầy đủ: Trung tâm thương mại, Trường mầm non quốc tế, Bể bơi bốn mùa, Xông hơi, Thư viện, Tập Golf 4D, Phòng hội thảo, Skybar, Sky Garden...
+ Pháp lý đầy đủ: Sổ hồng sở hữu lâu dài
+ Bàn giao nhà: Tháng 4/2025.
